import React from "react";
import { Grid } from "@material-ui/core";

class ImageCard extends React.Component {
  render() {
    const { description, id, urls } = this.props.image;
    return (
      // <div>
      <Grid item>
        <img
          src={urls.regular}
          alt={description}
          key={id}
          style={{ width: "300px" }}
        />
      </Grid>
      // </div>
    );
  }
}

export default ImageCard;
